sys_variable_value.value:
(function execute(inputs, outputs) {

var payload = {}

if (inputs.key.getValue("public_key")) { payload.key = inputs.key.getValue("public_key") } 
if (inputs.memo) { payload.memo = inputs.memo } 
if (inputs.reqsig) { payload.reqsig = inputs.reqsig }

if (inputs.sign_with) {
  payload.sign = []
  while (inputs.sign_with.next()) {
    payload.sign.push(inputs.sign_with.getValue("public_key"))
  }
}

outputs.payload = JSON.stringify(payload)

})(inputs, outputs);

