sys_variable_value.value:
(function execute(inputs, outputs) {

var tx = inputs.tx
var payload = {}

var key = new GlideRecord("x_snc_hconnector_key")
key.get(tx.key)

if (key.public_key) { payload.key = key.public_key.toString() } 
if (tx.memo) { payload.memo = tx.memo.toString() } 
if (tx.receiver_signature_required) { payload.reqsig = tx.receiver_signature_required }

outputs.payload = JSON.stringify(payload)

})(inputs, outputs);

